import React, { useState } from "react";
import "./Home.css";
import { Link, Routes, Route, useNavigate } from 'react-router-dom';
import Personality from "./Personality";

const Home = () => {
  const navigate = useNavigate();
  const [selectedHoroscope, setSelectedHoroscope] = useState('');
  
  function handleHoroscopeSelect(horoscope) {
    setSelectedHoroscope(horoscope);
    // Close the dropdown after selecting a horoscope
  }

  function handleClick(event) {
    event.preventDefault();
    navigate("/personality");
    console.log(selectedHoroscope);
  }
  function Dropdown() {
    const [isOpen, setIsOpen] = useState(false);
     return(
      <div>
        {isOpen &&
         <div>
          <h3>hello</h3>
          <h3>hello</h3>
          <h3>hello</h3>
          <h3>hello</h3>
          </div>
        }
      </div>
     )
  }
  return (
    <React.Fragment>
      <Link to="/personality"></Link>
      <Routes>
        <Route path="/personality" element={<Personality />} />
      </Routes>
      <div className='main-container'>
        <span className='text'>Find your match</span>
        <div className='wrapper-2'>
          <span className='text-2'>
            We match compatibility based on:
            <br />
            Personality
            <br />
            Aestheticism
            <br />
            Lifestyle
          </span>
        </div>
        <span className='text-3'>Horoscope</span>
        <form>
          <div className="form-group">
          
          {Dropdown()}
                Your Horoscope
          </div>
          <button onClick={handleClick} className="btn_text">
            Lets go !!
          </button>
        </form>
      </div>
    </React.Fragment>
  );
};

const DropdownItem = ({ text, onSelect }) => {
  return (
    <li className="dropdownItem" onClick={() => onSelect(text)}>
      <span>{text}</span>
    </li>
  );
};

export default Home;
